import "../styles/main.scss";
import Head from "next/head";
import React from "react";
export default function App({ Component, pageProps }) {
  return (
    <React.Fragment>
      <Head>
        <link rel="shortcut icon" href="./favicon.ico" />
      </Head>
      <Component {...pageProps} />;
    </React.Fragment>
  );
}
